import React from 'react';
import { IconButton } from '@material-ui/core';
import HelpIcon from '@material-ui/icons/Help';



const IconHelp = ({title}) =>{
  return (  <IconButton>
                 <HelpIcon />  
                 <p> {title} </p>
             </IconButton>);
}
export default IconHelp;
